INSERT INTO `tabWeb Page` VALUES
('about','2024-04-03 10:15:16.323504','2024-04-03 19:58:43.721352','Administrator','Administrator',0,0,'aboutdemo','aboutdemo',0,1,NULL,'HTML',NULL,0,NULL,NULL,'<!DOCTYPE html>\n<html lang=\"en\">\n<head>\n  <meta charset=\"UTF-8\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n  <title>MentMe: About Us</title>\n  <style>\n    body {\n      font-family: sans-serif;\n      margin: 2rem;\n    }\n\n    h1, h2, h3 {\n      margin: 1rem 0;\n    }\n\n    p {\n      line-height: 1.5;\n    }\n\n    ul {\n      list-style: disc;\n      padding: 0;\n    }\n\n    li {\n      margin: 0.5rem 0;\n    }\n  </style>\n</head>\n<body>\n  <h1>MentMe: About Us</h1>\n  <p>We believe everyone deserves to feel their best mentally and emotionally. That\'s why we created MentMe, your on-the-go companion for mental health tracking and self-care.</p>\n\n  <h2>Our Mission</h2>\n  <p>\n    * To empower individuals to take control of their mental wellbeing. <br>\n    * To make mental health resources accessible and easy to understand. <br>\n    * To foster a supportive community around mental health awareness.\n  </p>\n\n  <h2>The MentMe Team</h2>\n  <p>We\'re a passionate group of developers, mental health professionals, and wellness enthusiasts dedicated to building tools that help people thrive. Our team has extensive experience in:</p>\n  <ul>\n    <li>Mobile app development</li>\n    <li>Psychology and mental health</li>\n    <li>Mindfulness and self-care techniques  ‍♀️</li>\n  </ul>\n\n  <h2>Why Choose MentMe?</h2>\n  <p>Here\'s what sets us apart:</p>\n  <ul>\n    <li>Simple and User-Friendly: MentMe is designed to be easy to use, regardless of your technical expertise.</li>\n    <li>Personalized Support: Get personalized tips and recommendations based on your mood and goals. </li>\n    <li>Data-Driven Insights: Track your progress over time and identify patterns in your mental health.</li>\n    <li>Science-Backed Approach: Our app is built on evidence-based practices and techniques.</li>\n    <li>Safe and Secure: We take your privacy seriously. Your data is encrypted and protected.</li>\n  </ul>  \n\n  <h2>Join the MentMe Community!</h2>\n  <p>We believe in creating a safe space for open and honest conversations about mental health. Download MentMe and connect with others who are on their own journey to mental wellbeing.</p>\n\n  <h3>Stay Connected</h3>\n  <p>Follow us on social media for daily mental health tips and inspiration! (Add links to your social media pages here)</p>\n  <p>Let us know what you think! We value your feedback and suggestions. (Provide an email address for feedback)</p>\n\n  <p>Together, let\'s make mental health a priority!</p>\n\n</body>\n</html>',NULL,NULL,0,'Left',NULL,1,0,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL),
('about-us','2024-04-03 20:02:24.895714','2024-05-07 09:37:21.835888','Administrator','Administrator',0,0,'About us','about',0,1,NULL,'Page Builder',NULL,0,NULL,NULL,NULL,NULL,NULL,0,'Left',NULL,1,0,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL),
('dashboard','2024-04-03 22:32:55.378258','2024-05-07 09:35:47.762643','Administrator','Administrator',0,0,'Dashboard','dashboard',0,1,NULL,'Page Builder',NULL,0,NULL,NULL,NULL,NULL,NULL,0,'Left',NULL,1,0,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL),
