('238bev1pjp','2024-04-03 09:51:40.336751','2024-04-11 23:47:40.755972','Administrator','Administrator',0,2,'Section with Features','{\"title\":\"Why MentMe? \",\"subtitle\":\"Discover with us\",\"columns\":\"3\",\"features\":[{\"idx\":1,\"__islocal\":true,\"title\":\"Prioritize your mental health\",\"content\":\"Discover guided meditations and programs that help you stress less and learn to handle new challenges with ease.\",\"name\":\"row 1\"},{\"idx\":2,\"__islocal\":true,\"title\":\"Get more restful sleep\",\"content\":\"Find your perfect bedtime routine with hours of relaxing music, sounds, bedtime stories, and exercises.\",\"name\":\"row 2\"},{\"idx\":3,\"__islocal\":true,\"title\":\"Explore 50+ meditations\",\"content\":\"Access our entire library of meditations, sleep sounds, yoga and fitness, and focus music.\",\"name\":\"row 3\"}]}',NULL,NULL,1,1,1,0,0,0,0,0,NULL,'home','page_blocks','Web Page'),
