('chatwoot integration','2024-04-11 23:47:22.533261','2024-04-11 23:47:22.533261','Administrator','Administrator',0,0,'Section',0,'Website','<body>\r\n    <script>\r\n      (function(d,t) {\r\n        var BASE_URL=\"https://app.chatwoot.com\";\r\n        var g=d.createElement(t),s=d.getElementsByTagName(t)[0];\r\n        g.src=BASE_URL+\"/packs/js/sdk.js\";\r\n        g.defer = true;\r\n        g.async = true;\r\n        s.parentNode.insertBefore(g,s);\r\n        g.onload=function(){\r\n          window.chatwootSDK.run({\r\n            websiteToken: \'5QV3dMTMkjB1CF1L9TDhvnw2\',\r\n            baseUrl: BASE_URL\r\n          })\r\n        }\r\n      })(document,\"script\");\r\n    </script>\r\n    </body>',NULL,NULL,NULL,NULL),
