('Hero with Right Image','2020-04-17 12:18:04.376273','2024-04-04 09:20:46.094051','Administrator','Administrator',0,6,'Section',0,NULL,'<div class=\"hero-with-right-image\">\n	<div class=\"hero-content\">\n		<div>\n			<h1 class=\"hero-title\">\n				{{ _(title) }}\n			</h1>\n			{%- if subtitle -%}\n			<p class=\"hero-subtitle\">\n				{{ _(subtitle) }}\n			</p>\n			{%- endif -%}\n			<div>\n				{%- if primary_action -%}\n				<a class=\"btn btn-lg btn-primary\" href=\"{{ primary_action }}\">\n					{{ _(primary_action_label) }}\n				</a>\n				{%- endif -%}\n				{%- if secondary_action -%}\n				<a class=\"btn btn-lg btn-primary-light\" href=\"{{ secondary_action }}\">\n					{{ _(secondary_action_label) }}\n				</a>\n				{%- endif -%}\n			</div>\n		</div>\n	</div>\n	{%- if image -%}\n	{{ frappe.render_template(\'templates/includes/image_with_blur.html\', {\n		\"src\": image,\n		\"alt\": \"\",\n		\"class\": [\"hero-image\", \"contain-image\" if contain_image else \"\"]\n	}) }}\n	{%- endif -%}\n</div>\n',NULL,NULL,NULL,NULL),
('Html','2024-04-03 11:16:14.544405','2024-04-03 11:28:35.020425','Administrator','Administrator',0,0,'Section',0,'Website','\n<head>\n<style>\n  .container {  /* Added a container element */\n    text-align: center;  /* Center the content within the container */\n  }\n  \n  .laptop-image {\n    max-width: 80%;  /* Adjust percentage for desired width */\n    aspect-ratio: 16 / 9;  /* Maintain 16:9 aspect ratio */\n  }\n</style>\n</head>\n<body>\n  <div class=\"container\"> \n    <img src=\"{{ image }}\" alt=\"{{ alt }}\" class=\"laptop-image\">\n  </div>\n</body>\n',NULL,NULL,NULL,NULL),
('html with img1','2024-04-03 11:33:58.023960','2024-04-03 11:38:05.527225','Administrator','Administrator',0,0,'Section',0,'Website','<!DOCTYPE html>\n<html>\n<head>\n<style>\n  .container {\n    text-align: center;  /* Center the content within the container */\n    padding: 20px;  /* Add some padding for better aesthetics */\n  }\n\n  .laptop-image {\n    max-width: 80%;  /* Adjust percentage for desired width */\n    aspect-ratio: 16 / 9;  /* Maintain 16:9 aspect ratio */\n    margin: 0 auto;  /* Center the image horizontally within the container */\n  }\n\n  /* Optional heading styles (uncomment to use) */\n  .heading {\n    margin-bottom: 10px;  /* Add some space between heading and image */\n    font-size: 1.5em;  /* Adjust heading size as needed */\n  }\n</style>\n</head>\n<body>\n  <div class=\"container\">\n    <h2 class=\"heading\">{{ heading }}</h2>  <img src=\"{{ image }}\" alt=\"{{ alt }}\" class=\"laptop-image\">\n  </div>\n</body>\n</html>\n',NULL,NULL,NULL,NULL),
