('Section with Cards','2020-04-21 20:55:01.740525','2024-04-04 10:09:55.216617','Administrator','Administrator',0,29,'Section',0,'Website','{%- macro card(title, content, url, image) -%}\n{%- set col_classes = resolve_class({\n	\'col-12 col-sm-6 col-lg-3\': card_size == \'Small\',\n	\'col-12 col-sm-6 col-lg-4\': card_size == \'Medium\',\n	\'col-12 col-md-6\': card_size == \'Large\',\n}) -%}\n{%- set card_classes = resolve_class({\n	\'card-sm\': card_size == \'Small\',\n	\'card-md\': card_size == \'Medium\',\n	\'card-lg\': card_size == \'Large\'\n}) -%}\n<div class=\"mt-6 {{ col_classes }}\">\n	<div class=\"card {{ card_classes }} h-100\">\n		{%- if image -%}\n		{{ frappe.render_template(\'templates/includes/image_with_blur.html\', {\n			\"src\": image,\n			\"class\": [\"card-img-top\"]\n		}) }}\n		{%- endif -%}\n		<div class=\"card-body\">\n			<h3 class=\"card-title mt-0\">{{ title or \'\' }}</h3>\n			<p class=\"card-text\">{{ content or \'\' }}</p>\n		</div>\n		<a href=\"{{ url or \'#\' }}\" class=\"stretched-link\"></a>\n	</div>\n</div>\n{%- endmacro -%}\n\n<div class=\"section-with-cards\">\n	{%- if title -%}\n	<h2 class=\"section-title\">{{ title }}</h2>\n	{%- endif -%}\n	{%- if subtitle -%}\n	<p class=\"section-description\">{{ subtitle }}</p>\n	{%- endif -%}\n	{%- set card_size = card_size or \'Small\' -%}\n	<div class=\"{{ resolve_class({\'mt-6\': title}) }}\">\n		<div class=\"row mt-n6\">\n			{%- for index in [\'1\', \'2\', \'3\', \'4\', \'5\', \'6\', \'7\', \'8\', \'9\'] -%}\n			{%- set title = values[\'card_\' + index + \'_title\'] -%}\n			{%- set content = values[\'card_\' + index + \'_content\'] -%}\n			{%- set url = values[\'card_\' + index + \'_url\'] -%}\n			{%- set image = values[\'card_\' + index + \'_image\'] -%}\n			{%- if title -%}\n			{{ card(title, content, url, image) }}\n			{%- endif -%}\n			{%- endfor -%}\n		</div>\n	</div>\n</div>\n',NULL,NULL,NULL,NULL),
('Section with Collapsible Content','2020-08-07 16:27:38.265089','2020-10-26 17:40:20.365936','Administrator','Administrator',0,0,'Section',1,'Website','',NULL,NULL,NULL,NULL),
('Section with CTA','2020-04-17 19:57:40.534914','2024-04-03 22:19:26.705094','Administrator','Administrator',0,1,'Section',0,NULL,'<div class=\"section-cta-container\">\n	<div class=\"section-cta\">\n		<h2 class=\"title mt-0\">{{ _(title) }}</h2>\n		{%- if subtitle -%}\n		<p class=\"subtitle\">{{ _(subtitle) }}</p>\n		{%- endif -%}\n		<div class=\"mt-3\">\n			<h4 class=\"action\">\n				<a href=\"{{ cta_url }}\" class=\"no-decoration\">{{ _(cta_label) }}\n					<svg class=\"icon icon-md\"><use href=\"#icon-right\"></use></svg>\n				</a>\n			</h4>\n		</div>\n		{%- if cta_description -%}\n		<div class=\"description\">\n			{{ _(cta_description) }}\n		</div>\n		{%- endif -%}\n	</div>\n	{%- if show_confetti -%}\n		<div class=\"confetti confetti-1\"></div>\n		<div class=\"confetti confetti-2\"></div>\n		<div class=\"confetti confetti-3\"></div>\n	{%- endif -%}\n	{% if cta_url %}<a href=\"{{ cta_url }}\" class=\"stretched-link\"></a>{% endif %}\n</div>\n',NULL,NULL,NULL,NULL),
('Section with Embed','2020-08-18 17:45:13.606363','2020-09-11 15:52:40.439927','Administrator','Administrator',0,2,'Section',1,NULL,NULL,NULL,NULL,NULL,NULL),
('Section with Features','2020-08-18 13:10:11.476496','2024-05-06 23:59:16.778638','Administrator','Administrator',0,6,'Section',0,'Website','<div class=\"section-with-features\">\n	{%- if title -%}\n	<h2 class=\"section-title\">{{ _(title) }}</h2>\n	{%- endif -%}\n	{%- if subtitle -%}\n	<p class=\"section-description\">{{ _(subtitle) }}</p>\n	{%- endif -%}\n\n	<div class=\"section-features\" data-columns=\"{{ columns or 3 }}\"\n		{% if not subtitle %}style=\"margin-top: -1.5rem\"{% endif %}>\n		{%- for feature in features -%}\n		<div class=\"section-feature\">\n			<div>\n				{%- if feature.icon -%}\n				<img class=\"feature-icon\" src=\"{{ feature.icon }}\" alt=\"Icon for {{ feature.title }}\">\n				{%- endif -%}\n				{%- if feature.title -%}\n				<h3 class=\"feature-title mt-0\">{{ _(feature.title) }}</h3>\n				{%- endif -%}\n				{%- if feature.content -%}\n				<p class=\"feature-content\">{{ frappe.utils.md_to_html(_(feature.content)) }}</p>\n				{%- endif -%}\n			</div>\n			<div>\n				{%- if feature.url -%}\n				<a href=\"{{ feature.url }}\" class=\"feature-url stretched-link\"> {{ _(\"Learn more\") }} →</a>\n				{%- endif -%}\n			</div>\n		</div>\n		{%- endfor -%}\n	</div>\n</div>\n',NULL,NULL,NULL,NULL),
